import FacebookIcon from "../res/facebook.png";
import GoogleIcon from "../res/google.png";

export const data = [
  {
    img: FacebookIcon,
    name: "facebook",
    href: "auth/facebook",
    alt: "facebook-icon",
    color: "#3B5899",
    txt: "Login with Facebook",
  },
  {
    img: GoogleIcon,
    name: "google",
    href: "auth/google",
    alt: "google-icon",
    color: "#CB4024",
    txt: "Login with Google",
  },
];
